import styled from "styled-components";

const ImgContainer = styled.div`
    position:relative;
    width:250px;
    height:250x;
    background-color:red;
    margin:20px;

    img{
      width:100;
      height:100%;
      top:0;
      left:0;
      object-fit:cover;
    }
`;



function AnimalControl({item}) {
  return (
      <ImgContainer>
        <img src={item.Image}/>
      </ImgContainer>
  )
}

export default AnimalControl;
